INSERT INTO Backups (pwId, pwName, pwTitle, pwText, mTitle, mDescription, mKeywords, pMasterPage, pwDate, pBody, bType, pwFile) VALUES (23, N'default', N'My new website powered by razorC.net', '<p>razorC.net CMS - it is fast and easy way to start and maintain professional web site. Developed with ASP.net web pages (razor syntax) it is great for WebMatrix developers. Very easy to setup and modify. You can change any existing page layout to work with razorC.net in few minutes !!!</p>
